const Category = ({className} ) => {
    return (
        <div className={`flex justify-center items-center mx-auto font-prata text-sm font-medium text-black ${className}`}>
            <h1 className="text-[28px]">Категории</h1>
            
        </div>
    );
};

export default Category;
